08/Jul/21 4:59 PM;Camille.Fremed2@rtx.com;Network is open to all despite assurances that the Palo Alto FW was blocking all traffic and connections had to be whitelisted.  - *This has been mitigated by creating additional subnet groups and security groups.*

Any additional security groups that are added to the configuration are ineffective as the Ansible configuration re-instates the default groups. *Solution was to add what was needed, not change the defaults*

Documentation in confluence does not match the environment.  *This is being addressed as we find issues.  Would be helpful to have the documentation updated.*;;;

